import React, { PureComponent } from 'react'
import { Button, Navbar, Card } from "react-bootstrap";
import { useRouteMatch } from 'react-router-dom';

// rfc
class LogInPage extends PureComponent {

render(){
    return (
        <div>
            <CENTER><H1> CHINMAYI'S MINI DROPBOX</H1></CENTER>
                    <Button  variant="primary"  href="https://chinmayi-dropbox.auth.us-east-2.amazoncognito.com/login?client_id=5rvr724i7hngpqmmivbdo35gum&response_type=token&scope=aws.cognito.signin.user.admin+email+openid&redirect_uri=http://localhost:3000">
                        LogIn / SignUp  </Button>
        </div>

    );
    }
}

export default LogInPage
